import React from "react";
import Layout from "../Layout";
import banner from "../Images/banner.jpeg"

function Home() {
  return (
    <Layout>
      <div>
        <div className="home" style={{backgroundImage: `url(${banner})`}}>
         
          <h1> Food which is best in here</h1>
          <button>MEnu</button>
        </div>
      </div>
    </Layout>
  );
}

export default Home;
